export function Circle(x, y, dx, dy, radius) {
  const colorArray = [];

  this.x = x;
  this.y = y;
  this.dx = dx;
  this.dy = dy;
  this.radius = radius;
  this.minRadius = radius;
  this.maxRadius = radius * 10;
  this.color = colorArray[parseInt(Math.random() * colorArray.length)];
}
